    false,nt"url": null,nt"notes": "This data set is one of many developed
    in support of The High Plains Groundwater Availability Project and the U.S. Geological
    Survey Data Series report: titled Geodatabase Compilation of Hydrogeologic, Remote
    Sensing, and Water-Budget-Component data for the High Plains aquifer, 2011 (DS 777).
    This dataset contains point vector data of locations of 16,950 wells and 90,155
    well log records located in areas overlying the northern High Plains aquifer in
    the United States. The northern High Plains aquifer underlies 61.7 million acres
    (96,400 square miles) in Colorado, Kansas, Nebraska, South Dakota, and Wyoming.
    These data were acquired from different sources and synthesized together in one
    dataset. Included in this dataset is a point feature class (pts_Depth2Bedrock) of
    elevation values and depth values to the base of the northern High Plains aquifer
    as well as geospatial coordinates, a table containing a digital version of well
    logs (tbl_LithologyAggregate) with detailed subsurface material, texture, and sorting.",nt"owner_org":
